export default (function(a,b,c,d,e,f,g,h){return {data:{C3N8o70bHW:{data:{id:138,attributes:{imdbId:"tt0402763",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTk3NTU5NjgwN15BMl5BanBnXkFtZTcwNjUwMjEzMQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"4.5\u002F10"},{Source:"Rotten Tomatoes",Value:"67%"}],item_lang:{data:{id:801,attributes:{title:"Americanese",plot:"Long after their breakup, Chinese American Raymond Ding and Amerasian Aurora Crane struggle to let go. Torn apart by mismatched ideals, meddling friends, and the complexities of racial identities, they find other suitable mates but cannot stay away from each other.",slug:"americanese"}}},books:{data:[{id:2299,attributes:{title:d,description:e,thumbnail:f,authors:[a],firstBook:true,published:g,publisher:c,subtitle:h}},{id:2300,attributes:{title:d,description:e,thumbnail:f,authors:[a],firstBook:b,published:g,publisher:c,subtitle:h}},{id:2301,attributes:{title:"Homebase",description:"Homebase is the coming of age story of Rainsford Chan in 1950s and '60s California. Rainsford is a fourth-generation Chinese American named after the town where his great-grandfather worked during the gold rush. Orphaned at fifteen, he attempts to claim America as his homebase, and his personal history is interwoven with dreams, stories, and letters of his family's life in America. Moving through time and place, the story allows the reader to discover the past as Rainsford does, to see the world through his eyes, and to learn the truth about the Chinese American experience.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DSrvCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2016-04-18",publisher:c,subtitle:"A Novel"}},{id:2302,attributes:{title:"Asian Diasporas",description:"Asian diasporas are all too often seen in terms of settlement problems in a host nation, where the focus is on issues of crime, housing, employment, racism and related concerns. The essays in this volume view Asian diasporic movements in the context of globalization and global citizenship, in which multiple cultural allegiances, influences and claims together create complex negotiations of identity.Examining a range of cultural documents through which such negotiations are conducted — literature and other forms of writing, media, popular culture, urban spaces, military inscriptions, and so on — the essays in this volume explore the meanings and experiences involved in the two major Asian diasporic movements, those of South and East Asia.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FTa-AQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Robbie B.H. Goh",a],firstBook:b,published:"2004-03-01",publisher:"Hong Kong University Press",subtitle:"Cultures, Indentity, Representation"}},{id:2303,attributes:{title:"The Big Aiiieeeee!",description:"Includes prose, poetry, songs, excerpts from novels and plays",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VqHdAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:b,published:"1991-01-01",publisher:"Plume",subtitle:"An Anthology of Chinese American and Japanese American Literature"}}]}}},meta:{}}},prerenderedAt:1680940911875}}("Shawn Wong",null,"University of Washington Press","American Knees","Read about the movie, Americanese, based on Shawn Wong's book, at: http:\u002F\u002Fwww.americanesethemovie.com","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sIZaDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2005-05-15",""))